class Submission:
    def __init__(self, submission_id, data):
        self.submission_id = submission_id
        self.data = data
        self.status = 'Pending'
        self.errors = []

    def validate(self):
        if not self.data.get('name'):
            self.errors.append("Name is required.")
        if not isinstance(self.data.get('amount'), (int, float)) or self.data.get('amount') <= 0:
            self.errors.append("Amount must be a positive number.")
        if self.errors:
            self.status = 'Invalid'
        else:
            self.status = 'Valid'


class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def add_submission(self, submission_id, data):
        submission = Submission(submission_id, data)
        self.submissions[submission_id] = submission
        return submission

    def get_submission(self, submission_id):
        return self.submissions.get(submission_id)

    def update_submission_status(self, submission_id, status):
        submission = self.get_submission(submission_id)
        if submission:
            submission.status = status

    def delete_submissions_by_date(self, date):
        to_delete = [id for id, sub in self.submissions.items() if sub.data.get('submission_date') == date]
        for id in to_delete:
            del self.submissions[id]

    def generate_validated_file(self):
        validated_submissions = [sub for sub in self.submissions.values() if sub.status == 'Valid']
        with open('validated_submissions.csv', 'w') as f:
            for sub in validated_submissions:
                f.write(f"{sub.submission_id},{sub.data}\n")

    def get_status_of_all_submissions(self):
        return {id: sub.status for id, sub in self.submissions.items()}

    def sync_data_loads(self):
        # Placeholder for syncing logic
        print("Data loads synced.")


class User:
    def __init__(self, username, submission_manager):
        self.username = username
        self.submission_manager = submission_manager

    def submit_for_validation(self, submission_id):
        submission = self.submission_manager.get_submission(submission_id)
        if submission:
            submission.validate()

    def add_error_message(self, submission_id, message):
        submission = self.submission_manager.get_submission(submission_id)
        if submission:
            submission.errors.append(message)
            submission.status = 'Error'

    def update_submission_status(self, submission_id, status):
        self.submission_manager.update_submission_status(submission_id, status)


# Example usage:
submission_manager = SubmissionManager()
user = User(username='john_doe', submission_manager=submission_manager)

# Adding a submission
submission = submission_manager.add_submission('001', {'name': 'Sample Submission', 'amount': 100, 'submission_date': '2023-10-01'})
# Validating the submission
user.submit_for_validation('001')
# Updating status
user.update_submission_status('001', 'Processed')
# Adding an error message
user.add_error_message('001', 'Amount is too high.')  
# Generating validated file
submission_manager.generate_validated_file()
# Getting status of all submissions
status = submission_manager.get_status_of_all_submissions()
